const videos = [
    {
        name: 'Замикання від і до',
        duration: 15,
        id: 1,
    },
    {
        name: 'Роадмеп по JS',
        duration: 15,
        id: 2,
    },
    {
        name: 'Що таке FrontEnd',
        duration: 15,
        id: 3,
    },
    {
        name: 'Що таке FrontEnd2',
        duration: 10,
        id: 4,
    }
]

export function VideoList() {
    return (
        <> 
        <h1>Video List</h1>
        {
            videos.map((video) => {
                return (
                    <div>
                        <p>{video.name}</p>
                        <p>{video.duration}</p>
                        <button>Лайк!</button>

                    </div>
                )
            })
        }
        </>
    )
}
